import React from 'react';
import Frame70 from './Frame70';

const Banner = () => {
  return (
    <div
      style={{
        width: '100%',
        maxWidth: '1440px',
        height: '500px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
        background: 'rgba(210, 52, 41, 1)',
        position: 'relative',
      }}
    >
      {/* Decorative slice.png on the left */}
      <img
        src="/slice.png"
        alt="Decorative Slice"
        style={{
          position: 'absolute',
          left: '-49px',
          top: '334px',
          width: '133.24px',
          height: '134.95px',
          zIndex: 1,
          pointerEvents: 'none',
          userSelect: 'none',
        }}
      />
      <Frame70 />
    </div>
  );
};

export default Banner;
